import React, { useState, useEffect } from 'react'
import { useParams, Link } from 'react-router-dom'
import Axios from 'axios';

const EditData = () => {
  const { id } = useParams();
  const [user, setUser] = useState([]);

  function traerUser(){
    Axios.get(`/users/api/${id}`)
            .then(res => {
              console.log(res)
              setUser(res.data.vaults)
            })
            .catch(err => {
              console.log(err)
            })
  }
  useEffect(() => {
    traerUser();
  }, []);

  console.log(user);

  return (
    <>
      <div>hola</div>
    </>
  )
}

export default EditData
